eed is us to go all night\n\nAbout Ed Sheeran: \nEd Sheeranmay be the quintessential pop star of the 2010s: an internationally acclaimed, multi-award winning singer/songwriter who seems to acknowledge no boundaries between styles or eras with elements of folk, hip-hop, pop, dance, soul, and rock woven throughout his music. \n\nHis incredible catalogue includes the studio albums + (plus), x (multiply) and  (divide) which spawned hit singles such as The A team , Lego House, Sing', Thinking Out Loud, Photograph, Shape Of You, Castle on The Hill and Perfect. \n \nIn 2019, Ed Sheeran released the genre-spanning No.6 Collaborations Project which featured a wide-range of artists including Justin Bieber, Camilla Cabello, Travis Scott, Eminem, Cardi B, Paulo Londra, Bruno Mars and Stormzy amongst many others, producing hits such as I Dont Care, Beautiful People, South of The Border and Take Me Back To London. \n \n#EdSheeran #LilBaby #2step #equals","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Z_MvkyuOJgk/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLD8zycW-kbFWQAApMsvEOcB5xnC5w","width":168,"height":94},{"url":"https://i.ytimg.com/vi/Z_MvkyuOJgk/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLCgoM-k6XFYKEeLL42kpr__pYVzSQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/Z_MvkyuOJgk/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLCLj-LVInWOpL4hDVwvH9MBFgjj2g","width":246,"height":138},{"url":"https://i.ytimg.com/vi/Z_MvkyuOJgk/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLAqCCWdATNH28hCMMNJSDHdbkaC7g","width":336,"height":188},{"url":"https://i.ytimg.com/vi/Z_MvkyuOJgk/maxresdefault.jpg?v=62614821","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"58577804","author":"Ed Sheeran","isLowLatencyLiveStream":false,"isPrivate":false,"isUnpluggedCorpus":false,"latencyClass":"MDE_STREAM_OPTIMIZATIONS_REND  and caught up in the moment\n\nYou know you take all of my stress right down\nHelp me get it off my chest and out\nInto the ether with the rest of this mess\nThat just keeps us depressed\nWe forget that were here right now\n\nCoz were living life at a different pace\nStuck in a constant race keep the pressure on\nYoure bound to break\nSomethings got to change \nWe should just be cancelling all our plans\nAnd not give a damn \nIf were missing out on what the people think is right\n\nSeeing through a picture behind the screen\nAnd forget to be, lose the conversation for the message that youll never read\nI think maybe you and me \nOh we should head out to the place where the music plays\n\nAnd then well go all night\n\nTwo stepping with the woman I love\nAll my troubles turn to nothing when Im in your eyes\nElectrified, well keep turning up and go all night\nOh we had dips and falls in our time\nBut we know what it feels to be low then up, alone and then loved\nAnd all we need is us to go\nAll night, night\nTwo stepping with the woman I love\nNight, yeah, all we need is us\n\nBaby\nSun coming up when we walk out\nWe lost the track of time\nEverything that I been dealing with aint even cross my mind \nI dont see nobody in here but us for real\nFor you Im blind\nWe go anywhere\nIt dont take much for us to catch a vibe\n\nCome here I need to tell you something\nLet me whisper in your ear\nDo whatever to get you there Ill put you on a Lear\nPrivate island for a month straight\nTheyll think you disappeared\nLamb truck look good on ya\nIm copping you that urus\nI think Im bout ready to make love in this club\nOnly thing I need is my drank and my drugs\nI done got on 10 and forgot where I was\nSome parts I dont like but this part I love\n\nOnly me and my guys\nI been having me a good time\nYou can see it in all in my eyes\nTwo stepping with shorty\nGot her rocking side to side\nYou should let me know when you get ready to ride cause \n\nWell go all night\n\nTwo stepping with the woman I love\nAll my troubles turn to nothing when Im in your eyes\nElectrified, well keep turning up and go all night\nOh we had dips and falls in our time\nBut we know what it feels to be low then up, alone then loved\nAnd all we need is us to go\nAll night, night\nTwo step and with the woman I love\nNight, yeah, all we need is us to go all night\nNight, night\nTwo step and with the woman I love\nNight, yeah, all we need is us to go all night\n\nAbout Ed Sheeran: \nEd Sheeranmay be the quintessential pop star of the 2010s: an internationally acclaimed, multi-award winning singer/songwriter who seems to acknowledge no boundaries between styles or eras with elements of folk, hip-hop, pop, dance, soul, and rock woven throughout his music. \n\nHis incredible catalogue includes the studio albums + (plus), x (multiply) and  (divide) which spawned hit singles such as The A team , Lego House, Sing', Thinking Out Loud, Photograph, Shape Of You, Castle on The Hill and Perfect. \n \nIn 2019, Ed Sheeran released the genre-spanning No.6 Collaborations Project which featured a wide-range of artists including Justin Bieber, Camilla Cabello, Travis Scott, Eminem, Cardi B, Paulo Londra, Bruno Mars and Stormzy amongst many others, producing hits such as I Dont Care, Beautiful People, South of The Border and Take Me Back To London. \n \n#EdSheeran #LilBaby #2step #equals","commandRuns":[{"startIndex":55,"length":11,"onTap":{"innertubeCommand":{"clickTrackingParams":"CHMQsfcEGC4iEwim5tjDrJyFAxVfeE8EHfDtDAM=","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCVS88tG_NYgxF6Udnx2815Q","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCVS88tG_NYgxF6Udnx2815Q","canonicalBaseUrl":"/channel/UCVS88tG_NYgxF6Udnx2815Q"}}},"loggingDirectives":{"trackingParams":"CHMQsfcEGC4iEwim5tjDrJyFAxVfeE8EHfDtDAM=","enableDisplayloggerExperiment":true}},{"startIndex":120,"length":26,"onTap":{"innertubeCommand":{"clickTrackingPar
